import logo from './logo.svg';
import './App.css';

function App() {

  function hanjoo() {
    let insu = 'ZzangzzangInsu'
    let hanjoo = 'ZzangzzangHanjoo'
    return (
      <>
        <div><p>{insu} S2 {hanjoo}</p></div>
      </>
    )
  }




  return (
    <div className="App">
      {hanjoo()}
    </div>
  );
}

export default App;
